import * as React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Ionicons from 'react-native-vector-icons/Ionicons';
import 'react-native-gesture-handler';
import { createDrawerNavigator } from '@react-navigation/drawer';

// Screens
import HomeScreen from './screens/HomeScreen';
import Map from './screens/Map';
import Visit from './screens/Visit';
import Match from './screens/Match';
import Profile from './screens/Profile';
import Bookmark from './screens/Bookmark';
import Barcode from './screens/Barcode';
import Meeting from './screens/Meeting';
//Screen names
const homeName = "Home";
const MapsName = "Map";
const VisitName = "Visit";
const MatchName = "Match";


const Tab = createBottomTabNavigator();
const Drawer = createDrawerNavigator();
function MainContainer() {
  return (
    <NavigationContainer>
{/*
      <Tab.Navigator
        initialRouteName={homeName}
        screenOptions={({ route }) => ({
          tabBarIcon: ({ focused, color, size }) => {
            let iconName;
            let rn = route.name;

            if (rn === homeName) {
              iconName = focused ? 'home' : 'home-outline';

            } else if (rn === MapsName) {
              iconName = focused ? 'locate' : 'locate-outline';

            } else if (rn === VisitName) {
              iconName = focused ? 'today' : 'today-outline';
            } else if (rn === MatchName) {
                iconName = focused ? 'people' : 'people-outline';
            }
  

            // You can return any component that you like here!
            return <Ionicons name={iconName} size={size} color={color} />;
          },
        })}
        tabBarOptions={{
          activeTintColor: 'royalblue',
          inactiveTintColor: 'grey',
          labelStyle: { paddingBottom: 10, fontSize: 10 },
          style: { padding: 10, height: 70}
        }}>

        <Tab.Screen name={homeName} component={HomeScreen} />
        <Tab.Screen name={VisitName} component={Visit} />
        <Tab.Screen name={MapsName} component={Map} />
        <Tab.Screen name={MatchName} component={Match} />
      </Tab.Navigator>
      */}
      <Drawer.Navigator>
         <Drawer.Screen name="Home" component={ HomeScreen } />
         <Drawer.Screen name="Profile" component={ Profile } />
         <Drawer.Screen name="BarCode" component={ Barcode } />
         <Drawer.Screen name="Bookmark" component={ Bookmark } />
         <Drawer.Screen name="Meeting" component={ Meeting } />
      </Drawer.Navigator>

    </NavigationContainer>
  );
}

export default MainContainer;
